import React from 'react'

export default function Header() {
  return (
    <header>
        <h1 className='font-bold test-sm sm:text-xl flex flex-wrap'>
        <span className='text-slate-500'>Swara</span>
        <span className='text-slate-700'>Estate</span>
        </h1>
    </header>
  )
}
